import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  lojaContainer: {
    flex: 6,
    flexDirection: "row",
    paddingHorizontal: "5%",
    paddingVertical: "5%",
  },
  col1: {
    flex: 2,
  },
  col2: {
    flex: 2,
  },
  col3: {
    flex: 1,
    marginTop: "10%",
    paddingLeft: "10%",
    alignItems: "center",
  },
});

export default styles;
